import React from 'react';

import Auth from '../AuthForm/AuthForm.jsx';
import Input from '../Input/Input.jsx';

function Login() {
  return (
    <Auth
      formName="login"
      title="Рады видеть!"
      btnText="Войти"
      onSubmit={(e) => e.preventDefault()}
    >
      <Input
        title="E-mail"
        name="email"
        type="email"
        className="input input_type_auth"
        addClassName="input_display_block"
      />
      <Input
        title="Пароль"
        name="password"
        type="password"
        className="input input_type_auth"
        addClassName="input_display_block"
      />
    </Auth>
  );
}

export default Login;
